import React from "react";
import Data from "../example_data.json";

import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Typography from "@mui/material/Typography";
import Avatar from "@mui/material/Avatar";
import FiberManualRecordIcon from "@mui/icons-material/FiberManualRecord";

import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";
import {CardActionArea} from "@mui/material";
import {flexbox} from "@mui/system";
import {Box} from "@mui/material";

export const PlaceList = () => {
  const Date = (value) => {
    return value
      .filter((item) => item.day === "Monday")
      .map((item) => `${item.time_open} AM - ${item.time_close} PM`);
  };

  const info = Data.map((item) => (
    <Card
      key={item.id}
      sx={{
        bgcolor: "background.paper",
        m: 1,
        border: 1,
        borderColor: "primary.main",
        width: "10",
      }}>
      <CardHeader
        avatar={
          <Avatar src={item.profile_image_url} variant="rounded">
            {" "}
            {item.id}
          </Avatar>
        }
        action={<FiberManualRecordIcon />}
        title={item.name}
        subheader={Date(item.operation_time)}
      />
      <ImageList sx={{width: 500, height: 450}} cols={3} rowHeight={164}>
        <ImageListItem>
          <img src={item.images} />
        </ImageListItem>
      </ImageList>
    </Card>
  ));

  return <>{info}</>;
};
